import React, { Component } from 'react'
import { Link } from 'react-router-dom';

const divStyle = {
    backgroundColor:"lightblue" ,
    marginTop :"10px", 
    borderRadius:"10px"
}


class AdminPannel extends Component {
    render(){

        return (
            <div className="container">
                <ul className="collection with-header">
                    <li className="collection-item" style={divStyle}><div><h4 >Home<Link to="/home" className="secondary-content"><i className="material-icons">send</i></Link></h4></div></li>
                    <li className="collection-item" style={divStyle}><div><h4 >Add New Election<Link to="/newElection" className="secondary-content"><i className="material-icons">send</i></Link></h4></div></li>
                    <li className="collection-item" style={divStyle}><div><h4 >Election List<Link to="/elections" className="secondary-content"><i className="material-icons">send</i></Link></h4></div></li>
                </ul>
            </div>


        )
    }
}

export default AdminPannel;
